export default function ViewProduct(props){
    return(
        <section className="aem-Grid aem-Grid--12">
            
            {props.data.map((prod) => {
                return (
                    <>
                    <img src={prod.image} alt={prod.title}/>
                    </>
                );
            })
        }
        

        </section>
    );
}
